import React, { useState, useEffect } from 'react';
import './App.css';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { addDays, isBefore, setHours, startOfDay } from 'date-fns';

function App() {
  const [orderNumber, setOrderNumber] = useState('');
  const [name, setName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [deliveryAddress, setDeliveryAddress] = useState('');
  const [deliveryDate, setDeliveryDate] = useState(null);
  const [error, setError] = useState('');
  const [successMessage, setSuccessMessage] = useState('');
  const [deliveries, setDeliveries] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5001/api/deliveries')
      .then(response => response.json())
      .then(data => setDeliveries(data))
      .catch(error => console.error('Error fetching deliveries:', error));
  }, []);

  const isDeliveryDateDisabled = (date) => {
    const now = new Date();
    const maxAdvanceDate = addDays(now, 3);
    const nextDay11AM = setHours(addDays(now, 1), 11);
    const fifteenHoursBeforeNextDay11AM = setHours(nextDay11AM, -15);

    if (isBefore(date, now) || isBefore(maxAdvanceDate, date)) {
      return true;
    }

    if (isBefore(now, fifteenHoursBeforeNextDay11AM) && date.toDateString() === nextDay11AM.toDateString()) {
      return true;
    }

    const deliveriesOnSelectedDate = deliveries.filter(
      delivery => new Date(delivery.deliveryDate).toDateString() === date.toDateString()
    );

    if (deliveriesOnSelectedDate.length >= 8) {
      return true;
    }

    return false;
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    if (!orderNumber || !name || !phoneNumber || !deliveryAddress || !deliveryDate) {
      setError('All fields are required.');
    } else {
      setError('');
      setSuccessMessage('');
      // Send data to the server
      fetch('http://localhost:5001/api/submit', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          orderNumber,
          name,
          phoneNumber,
          deliveryAddress,
          deliveryDate
        }),
      })
      .then(response => response.json())
      .then(data => {
        console.log('Success:', data);
        setSuccessMessage('Order details submitted successfully!');
        setDeliveries([...deliveries, { deliveryDate }]); // Update deliveries list
      })
      .catch((error) => {
        console.error('Error:', error);
        setError('Error submitting order details.');
      });
    }
  };

  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        <label htmlFor="orderNumber">Order #*</label>
        <input
          type="text"
          id="orderNumber"
          value={orderNumber}
          onChange={(e) => setOrderNumber(e.target.value)}
        />

        <label htmlFor="name">Name*</label>
        <input
          type="text"
          id="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />

        <label htmlFor="phoneNumber">Phone Number*</label>
        <input
          type="text"
          id="phoneNumber"
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
        />

        <label htmlFor="deliveryAddress">Delivery Address*</label>
        <input
          type="text"
          id="deliveryAddress"
          value={deliveryAddress}
          onChange={(e) => setDeliveryAddress(e.target.value)}
        />

        <label htmlFor="deliveryDate">Delivery Date*</label>
        <DatePicker
          selected={deliveryDate}
          onChange={date => setDeliveryDate(date)}
          filterDate={isDeliveryDateDisabled}
          minDate={startOfDay(new Date())}
          placeholderText="Select a delivery date"
        />

        {error && <div className="error">{error}</div>}
        {successMessage && <div className="success">{successMessage}</div>}
        <button type="submit">NEXT â†’</button>
      </form>
    </div>
  );
}

export default App;
